import cv2
import numpy as np
import matplotlib.pyplot as plt

# Load a grayscale image
image = cv2.imread('tiger.jpg', cv2.IMREAD_GRAYSCALE)

# Display the original image
plt.figure(figsize=(6,6))
plt.imshow(image, cmap='gray')
plt.title("Original Image")
plt.axis('off')
plt.show()

"""#2.Compute Fourier Transform & Magnitude Spectrum

![image.png](data:image/png;base64,)
"""

# Compute DFT
dft = cv2.dft(np.float32(image), flags=cv2.DFT_COMPLEX_OUTPUT)

# Shift the zero frequency component to the center
dft_shift = np.fft.fftshift(dft)

# Compute magnitude spectrum
magnitude_spectrum = 20 * np.log(cv2.magnitude(dft_shift[:,:,0], dft_shift[:,:,1]))

plt.figure(figsize=(6,6))
plt.imshow(magnitude_spectrum, cmap='gray')
plt.title("Magnitude Spectrum")
plt.axis('off')
plt.show()

"""![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

#3.Apply Low-Pass Filtering (Smoothing)
"""

rows, cols = image.shape
crow, ccol = rows//2 , cols//2  # Center of image

# Create a mask with a centered low-pass filter
mask = np.zeros((rows, cols, 2), np.uint8)
mask[crow-30:crow+30, ccol-30:ccol+30] = 1  # Low-pass region

# Apply mask to DFT
dft_shift_lp = dft_shift * mask

# Inverse DFT
dft_ishift = np.fft.ifftshift(dft_shift_lp)
img_lp = cv2.idft(dft_ishift)
img_lp = cv2.magnitude(img_lp[:,:,0], img_lp[:,:,1])

plt.figure(figsize=(6,6))
plt.imshow(img_lp, cmap='gray')
plt.title("Low-Pass Filtered (Smooth) Image")
plt.axis('off')
plt.show()

"""#4: Apply High-Pass Filtering (Sharpening)"""

# Create a high-pass filter mask
mask_hp = np.ones((rows, cols, 2), np.uint8)
mask_hp[crow-30:crow+30, ccol-30:ccol+30] = 0  # High-pass region

# Apply mask to DFT
dft_shift_hp = dft_shift * mask_hp

# Inverse DFT
dft_ishift_hp = np.fft.ifftshift(dft_shift_hp)
img_hp = cv2.idft(dft_ishift_hp)
img_hp = cv2.magnitude(img_hp[:,:,0], img_hp[:,:,1])

plt.figure(figsize=(6,6))
plt.imshow(img_hp, cmap='gray')
plt.title("High-Pass Filtered (Sharpened) Image")
plt.axis('off')
plt.show()

"""#5.Apply Inverse Fourier Transform

Convert filtered images back to spatial domain
"""

dft_ishift_orig = np.fft.ifftshift(dft_shift)
img_reconstructed = cv2.idft(dft_ishift_orig)
img_reconstructed = cv2.magnitude(img_reconstructed[:,:,0], img_reconstructed[:,:,1])

plt.figure(figsize=(6,6))
plt.imshow(img_reconstructed, cmap='gray')
plt.title("Reconstructed Image (Inverse Fourier Transform)")
plt.axis('off')
plt.show()

"""#6: Low-Pass Filtering (Smoothing) with Different Sizes

(Manually testing different cutoff sizes for blurring effect)

#LowPass Filtering with the circular radius of 20.
"""

# Trying a small cutoff size
mask1 = np.zeros((rows, cols, 2), np.uint8)
mask1[crow-20:crow+20, ccol-20:ccol+20] = 1  # Small filter

# Applying mask
dft_shift_lp1 = dft_shift * mask1

# Converting back to spatial domain
dft_ishift1 = np.fft.ifftshift(dft_shift_lp1)
img_lp1 = cv2.idft(dft_ishift1)
img_lp1 = cv2.magnitude(img_lp1[:,:,0], img_lp1[:,:,1])

plt.figure(figsize=(6,6))
plt.imshow(img_lp1, cmap='gray')
plt.title("Low-Pass Filter (Small Cutoff)")
plt.axis('off')
plt.show()

"""#LowPass Filtering with the circular radius of 50."""

# Trying a bigger cutoff size
mask2 = np.zeros((rows, cols, 2), np.uint8)
mask2[crow-50:crow+50, ccol-50:ccol+50] = 1  # Larger filter

# Applying mask
dft_shift_lp2 = dft_shift * mask2

# Converting back
dft_ishift2 = np.fft.ifftshift(dft_shift_lp2)
img_lp2 = cv2.idft(dft_ishift2)
img_lp2 = cv2.magnitude(img_lp2[:,:,0], img_lp2[:,:,1])

plt.figure(figsize=(6,6))
plt.imshow(img_lp2, cmap='gray')
plt.title("Low-Pass Filter (Larger Cutoff)")
plt.axis('off')
plt.show()

"""![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

#Side by Side Comparison:
"""

plt.subplot(1,2,1)

plt.imshow(img_lp1,cmap='gray')
plt.title("Low-Pass Filter (Cutoff Size = 20)")
plt.axis('off')

plt.subplot(1,2,2)
plt.imshow(img_lp2,cmap='gray')
plt.title('Low Pass Filter (Cutoff Size = 50)')

plt.tight_layout()
plt.show()

"""# High-Pass Filtering (Sharpening) with Different Sizes.

(Manually testing different cutoff sizes for sharpening effect)

#HighPass Filtering with the circular radius of 20.
"""

# Trying a small cutoff size
mask_hp1 = np.ones((rows, cols, 2), np.uint8)
mask_hp1[crow-20:crow+20, ccol-20:ccol+20] = 0  # Small high-pass filter

# Applying mask
dft_shift_hp1 = dft_shift * mask_hp1

